        const getItem = async () => {
            const res = await fetch("/userDetails");
            const getData = await res.json();
            const userData = Array.from(getData);
            setItem(getData);
            console.log(userData);
        }
        getItem();
    }, []);
    return (
        <div className='Home'>
            <NavbarLoggedIN/>
            <p>Howdy {getItem.name}</p>
        </div>
    );
}

export default Home;
